import React, { useContext } from 'react';
import ImageContext from './imageContext';

function OpenStreetCam() {
    const ctxLocal = useContext(ImageContext)

    console.log('OpenStreetCam');

    fetch('https://api.openstreetcam.org/2.0/photo/?lat=50.9413&lng=6.9583&radius=500')
        .then(response => {
            console.log('Status:', response.status);
            return response.json();
        })
        .then(data => {
            console.log('Data:', data);
            const firstPhoto = data.result.data[0];
            console.log('First photo:', firstPhoto);
            console.log('First photo ID:', firstPhoto.id);
            console.log('First photo URL:', firstPhoto.fileurl);
            ctxLocal.setImageData("ImageUrl", firstPhoto.fileurl);
        })
        .catch(error => {
            console.error('Error:', error);
        });

    return (
        <div id='Streetimage'>
            hier könnte Ihre Werbung stehen!
        </div>
    );
}

export default OpenStreetCam;
